import React from "react";

const Full_Middle = ({ title, describe, cover }) => {
  return (
    <section
      className="h-screen bg-fullcenter"
      style={{ backgroundImage: "url(" + cover + ")" }}
    >
      <div className="">
        <h2 className="md:text-3xl text-2xl">{title}</h2>
      </div>
    </section>
  );
};

export default Full_Middle;
